#include<iostream>
#include<algorithm>
#define rep(i,rept) for (ll i = 0; i < rept; i++)
	typedef long long ll;

	int main() {
		ll i = 0, j = 0;
		ll n = 0,ans = 0;
		ll count = 0;
		std::cin >> n;
		for (int i = 1; i < n; i++) {
			count = 0;
			for (j = 1; j <= i; j++) {
				if (i%j == 0) {
					count++;
				}
				if (count > 2) {
					break;
				}
			}
			if (count == 2) {
				ans++;
			}
		}
		std::cout << ans << std::endl;

	}
